import './NextviewportMenu.css';



const NextviewportMenu = () =>{
    
    
    const handleClick = () =>{
        const section1 = document.getElementById('section1');
        if (section1) {
            section1.scrollIntoView({behavior:"smooth"});
        }
    }
    
    return(
        <ul className="next-viewport-menu">
            <li onClick={handleClick}></li>
            <li onClick={handleClick}></li>
